import React from 'react';
import { IoMdContact } from 'react-icons/io';
import { Animate } from "react-simple-animate";
import PageHeaderContent from '../../components/pageHeaderContent';

const Contact = () => {
    return(
        <section id='contact' className='contact'>

            <PageHeaderContent headerText = 'Contact Me' icon={<IoMdContact size={40} />} />

            <div className='contact_content'>

                <Animate play duration={1} delay={0} start={{ transform: "translateX(-200px)"}} end={{ transform: "translateX(0px)"}}>
                    <h3 className='contact_content_header-text'>
                        Send Me!
                    </h3>
                </Animate>

                <Animate play duration={1} delay={0} start={{ transform: "translateX(200px)"}} end={{ transform: "translateX(0px)"}}>

                    <div className='contact_contact-form'>
                        <div className='contact_contact-form_controlswrapper'>
                            <div className='nameWrapper'></div>
                            <div className='emailWrapper'></div>
                            <div className='descriptionWrapper'></div>

                        </div>

                    </div>


                </Animate>

            </div>

        </section>
    )
}

export default Contact;
